package com.nopalyer.navigationdrawer.AboutNithhp;

import java.util.ArrayList;

public class AboutnithData {
    public static String [][] aboutdata = new String[][]{
            {"About City : Hamirpur","data:image/webp;base64,"},
            {"About College","data:image/webp;base64,"},
            {"College Magazine","data:image/webp;base64,"},
            {"Vision and Mission","data:image/webp;base64,"}
    };


    public static ArrayList<Abnith> getlistAboutnithData(){
        Abnith abnith;
        ArrayList<Abnith> list45 = new ArrayList<>();
        for(String[] mAboutnithData : aboutdata){

            abnith = new Abnith();
            abnith.setName(mAboutnithData[0]);
            abnith.setPhoto(mAboutnithData[1]);

            list45.add(abnith);
        }
        return list45;
    }
}
